// src/pages/RegisterPage.js
import React, { useState } from 'react';
import '../styles/common.css';

function RegisterPage() {
  const [formData, setFormData] = useState({
    fullName: '',
    email: '',
    password: '',
    confirmPassword: '',
    acceptedTerms: false,
  });

  const [error, setError] = useState('');
  const [success, setSuccess] = useState(false);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({ ...formData, [name]: type === 'checkbox' ? checked : value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setError('');
    setSuccess(false);

    if (!formData.email.includes('@')) {
      setError('Please enter a valid email.');
      return;
    }
    if (formData.password.length < 6) {
      setError('Password must be at least 6 characters.');
      return;
    }
    if (formData.password !== formData.confirmPassword) {
      setError('Passwords do not match.');
      return;
    }
    if (!formData.acceptedTerms) {
      setError('You must accept the terms and conditions.');
      return;
    }

    setSuccess(true);
  };

  return (
    <div className="reg-page-bg">
      <div className="top-right-login">
        <a href="/login">Already registered? <button className="login-btn">Login</button></a>
      </div>
      <div className="register-card">
        <h2 className="register-title">Registration</h2>
        <form onSubmit={handleSubmit} className="register-form">
          <div className="form-field">
            <label>Full Name</label>
            <input 
              type="text" name="fullName" placeholder="Enter full name" 
              value={formData.fullName} onChange={handleChange} required 
            />
          </div>

          <div className="form-field">
            <label>Email Address</label>
            <input 
              type="email" name="email" placeholder="Enter email" 
              value={formData.email} onChange={handleChange} required 
            />
          </div>

          <div className="form-field">
            <label>Password</label>
            <input 
              type="password" name="password" placeholder="Create password" 
              value={formData.password} onChange={handleChange} required 
            />
          </div>

          <div className="form-field">
            <label>Confirm Password</label>
            <input 
              type="password" name="confirmPassword" placeholder="Confirm password" 
              value={formData.confirmPassword} onChange={handleChange} required 
            />
          </div>

          <div className="form-field">
            <label>
              <input 
                type="checkbox" name="acceptedTerms" checked={formData.acceptedTerms} 
                onChange={handleChange} 
              /> I accept all terms & conditions
            </label>
          </div>

          <button type="submit" className="signup-btn">Sign Up</button>

          {error && <div className="form-error">{error}</div>}
          {success && <div className="form-success">âœ… Registered!</div>}

          <div className="divider"><span>Or sign in with:</span></div>

          <button type="button" className="facebook-btn social-btn">
            <img src="/assets/facebook-logo.png" alt="fb" className="icon" />
            Login with Facebook
          </button>

          <button type="button" className="google-btn social-btn">
            <img src="/assets/google-logo.png" alt="google" className="icon" />
            Login with Google
          </button>
        </form>
      </div>
    </div>
  );
}

export default RegisterPage;
